import React, { Component } from "react";
import "./style.css";

export default class SearchResults extends Component {
    constructor(props) {
        super(props);
        console.log("this is my initializer");

        this.state = {
            rows: <p>This is my row</p>
        }
    }

    render() {
        return (
            <div>
                {this.state.rows}
            </div>
        );
    }

}
